import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import pic1 from "./pics/fireplanet1.png";

class App extends Component {
  constructor(props) {
    super(props);

    const artworks = [{ id: 0, img: pic1, title: "Your Mom" }];
    this.state = { rows: <p>This is my row</p> };
  }
  render() {
    return (
      <div className="App">
        <header className="toolbar">
          <ul>
            <li className="title">Cooper Hewitt</li>
            <li className="about">About</li>
          </ul>
        </header>
      </div>
    );
  }
}

export default App;
